import React, {useState} from 'react';

//Packages
import {Link} from 'react-router-dom';
import {FaShoppingBasket as NavLogo} from 'react-icons/fa'
import {RiShoppingCartLine as CartLogo} from 'react-icons/ri';

//Components
import Button from './../button/Button';

//CSS
import './Nav.css';

function Nav() {
    const [navClick, setNavClick] = useState(false);
    const [button, setButton] = useState(true);

    const onHandleClick = () => setNavClick(!navClick);

    const closeMobileMenu = () => setNavClick(false);

    const showButton = () => {
        if (window.innerWidth <= 960) {
            setButton(false)
        } else {
            setButton(true);
        }
    };

    window.addEventListener('resize', showButton)

    return (
        <>
            <div className="nav__top">
                All of your favorites in one place
            </div>

            <nav className={'shadow-5'}>
                <div className={'container'}>

                    <ul>
                        <Link to={'/'}>
                            <li className={'nav__logo'}>
                                Grcy
                                <NavLogo className={'fl w-20'}/></li>
                        </Link>
                    </ul>

                    <ul>

                        <Link>
                            <li className={''}>
                                <input placeholder={'SEARCH...'}/>
                            </li>
                        </Link>

                        <Link to={'/'}>
                            <li className={'login'}>Login</li>
                        </Link>

                        <Link to={'/'}>
                            <li className={'cart'}>
                                Cart
                                <CartLogo className={'fl w-80'} size={20}/>
                            </li>
                        </Link>

                    </ul>
                </div>

            </nav>
        </>
    )
}

export default Nav;
